file.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2024-08-07 05:36:23', '2024-08-07 05:36:23', '', '0', 'https://lapharmacia.com/?post_type=wpcf7_contact_form&p=15', '0', 'wpcf7_contact_form', '', '0');
